import React from "react";
import styled from "styled-components";

const Brands = () => {
    return (
        <BoxSection>
            <WrapperContent>
                <Content>
                    <Title>Horizontal Logo</Title>
                    <WrapperLogo>
                        <BrandLogo></BrandLogo>
                        <BrandLogo></BrandLogo>
                        <BrandLogo></BrandLogo>
                        <BrandLogo></BrandLogo>
                    </WrapperLogo>
                </Content>
                <Content></Content>
                <Content></Content>
                <Content></Content>
            </WrapperContent>
        </BoxSection>
    );
};

const BoxSection = styled.section`
    position: relative;
    padding: 8vh 0 0;
    margin: 0 0 2rem;
    @media (max-width: 770px) {
        padding-top: 60px;
        margin: 0 0 1rem;
    }
`;
const WrapperContent = styled.div``;
const Content = styled.div``;
const Title = styled.div``;
const WrapperLogo = styled.div`
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    gap: 2rem;
`;
const BrandLogo = styled.div`
    height: 200px;
    width: 350px;
    background-color: #0c3d68;

    border-radius: 20px;
`;

export default Brands;
